--One time insert for agents in the project spreadsheet, after which it will be handled by the daily scheduled job

alter session set current_schema = folsom_shared_cc;


COMMIT;


 
 
commit;


update cc_s_agent_first_call_dt a
set a.agent_id = (select b.agent_id from cc_s_agent b where b.login_id = a.login_id);

update cc_s_agent_first_call_dt a
set a.project_name = (select c.project_name from cc_s_agent b, cc_c_project_config c
                          where b.login_id = a.login_id and b.project_config_id = c.project_config_id);
                          
update cc_S_agent_first_call_dt
set project_name = 'TN ERPC'
where department = 'TennCare'
and project_name is null;

update cc_S_agent_first_call_dt
set project_name = 'MassHealth'
where department = 'MassHealth'
and project_name is null;

commit;